import React from 'react';

const {useState} = React;

export default function App() {
  const [counter, setCounter] = useState(0);
  return (
    <div>
      <h1>Hello React</h1>
    <p>{counter}</p>
    <button onClick={
      () => {
        setCounter(counter + 1)
      }
    }>Increase</button>
    <button onClick = {
      () => {
        setCounter(counter - 1)
      }
    }> Decrease </button>
    </div>
  )
}
